Using `Object.fromEntries` can be more performant than `reduce` with object spreading for constructing the dependencies object.[^1] This approach avoids creating a new object on each iteration, improving efficiency, especially with larger dependency lists.

```typescript
return Object.fromEntries(
		await Promise.all(
			Object.entries(dependencies).map(async ([pkg, ver]) => {
				if (ver !== "workspace:*") return [pkg, ver];
				const latest = await latestVersion(pkg);
				return [pkg, latest];
			}),
		),
	);
```

